  getAssetData() {
    return this.http.get<any>(`${this.dummyApiUrl}/dummyData4.json`);
  }

  getVelocityP2P() {
    return this.http.get<any>(`${this.dummyApiUrl}/` + `velocityP2P.json`);
  }
  getVelocityPEAK() {
    return this.http.get<any>(`${this.dummyApiUrl}/` + `velocityPEAK.json`);
  }
  getVelocityRMS() {
    return this.http.get<any>(`${this.dummyApiUrl}/` + `velocityRMS.json`);
  }

  getVelocityRMSapi(id) {
    return this.http.get<any>(`${this.apiUrl}` + `get_velocity_rms/` + id + '/');
  }

  getAcceleration(id) {
    return this.http.get<any>(`${this.apiUrl}` + `get_acceleration_data/` + id + '/');
  }
  getVelocity(id) {
    return this.http.get<any>(`${this.apiUrl}` + `get_velocity_data/` + id + '/');
  }
  getDisplacement(id) {
    return this.http.get<any>(`${this.apiUrl}` + `get_displacement_data/` + id + '/');
  }

  // getAssetDeviceData(id){
  //   return this.http.get<any>(`${this.dummyApiUrl}`+ `/asset_data.json`);  
  // }
  getAssetDeviceData(id) {
    return this.http.post<any>(`${this.apiUrl}` + `get_devices/`, { "asset_id": id });
  }
  getAccelerationAmplitude(data, domain = 'amplitude') {
    return this.http.post<any>(`${this.apiUrl}` + `get_acceleration_` + domain + `/`, data);
  }
  getVelocityAmplitude(data, domain = 'amplitude') {
    return this.http.post<any>(`${this.apiUrl}` + `get_velocity_` + domain + `/`, data);
  }
  getDisplacementAmplitude(data, domain = 'amplitude') {
    return this.http.post<any>(`${this.apiUrl}` + `get_displacement_` + domain + `/`, data);
  }

  getRMSRangeData(data) {
    return this.http.post<any>(`${this.apiUrl}` + `get_velocty_rms_range/`, data);
  }

  getAssetList(data) {
    return this.http.post<any>(`${this.apiUrl}` + `asset_data/`, data)
  }
